["all_trips_v2 %>% # data set is declared \n","  group_by(usertype, bike_id) %>% #grouping by usertype and bike_id as the visual is based upon these two\n","  summarise(number_of_rides = n()) %>% # summarise function with n() is used to count the number of rides\n","  ggplot(mapping = aes( x = bike_id ,  y = number_of_rides, fill = usertype))+ # mapping the visual with bike_id on x axis and no of rides on y-axis and using fill to display graph according to usertype\n","  geom_col(position = \"dodge\")+ #specifying the type of graph to be used\n","  labs(title = \"Preferred bike types by Users\", #using labs to make graph more readable\n","       x = \"Bike Type\",\n","       y = \"Number of Rides\",\n","       fill = \"Rider type\")"]},{"cell_type":"markdown","id":"58caa8dd","metadata":{"papermill":{"duration":0.021849,"end_time":"2022-07-19T10:44:08.903103","exception":false,"start_time":"2022-07-19T10:44:08.881254","status":"completed"},"tags":[]},"source":["### Key Takeaways"]},{"cell_type":"markdown","id":"aca5fc3a","metadata":{"papermill":{"duration":0.02193,"end_time":"2022-07-19T10:44:08.946711","exception":false,"start_time":"2022-07-19T10:44:08.924781","status":"completed"},"tags":[]},"source":["* Member riders take more rides but spend less time riding than casual riders.\n","* Both casual and member riders have a preference for the classic bike than the other bike types.\n","* Casual riders use Cyclistic more during the weekends compared to member riders that have an approximate   even spread through the week\n"]},{"cell_type":"markdown","id":"1ab14aad","metadata":{"papermill":{"duration":0.022301,"end_time":"2022-07-19T10:44:08.990192","exception":false,"start_time":"2022-07-19T10:44:08.967891","status":"completed"},"tags":[]},"source":["### Recommendations"]},{"cell_type":"markdown","id":"106cc5f1","metadata":{"papermill":{"duration":0.022007,"end_time":"2022-07-19T10:44:09.033572","exception":false,"start_time":"2022-07-19T10:44:09.011565","status":"co